import React from 'react';
import PropTypes from 'prop-types';

export const LogItem = ({ log }) => {
  return (
    <li className="collection-item">
      <div>
        <a href="#">{log.message}</a>
      </div>
    </li>
  );
};

LogItem.propTypes = {
  log: PropTypes.object.isRequired,
};

export default LogItem;
